class Solution(object):
    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # 1. Mark all negative numbers, 0s, and numbers larger than n as invalid
        # 2. Iterate through the array and mark the numbers as seen
        # 3. Iterate through the array again and return the first number that is not seen

        n = len(nums)

        for i in range(n):
            if nums[i] <= 0:
                nums[i] = n + 1

        for i in range(n):
