class Solution(object):
    def licenseKeyFormatting(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: str
        """

        s = s.replace('-', '').upper()
        n = len(s)
        if n <= k:
            return s

        res = []
        i = n - 1
        while i >= 0:
            res.append(s[i])
            i -= k
            if i >= 0 and i % k == 0:
                res.append('-')
            i -= 1
        return ''.join(res[::-1])

