    def findRedundantDirectedConnection(self, edges):
        """
        :type edges: List[List[int]]
        :rtype: List[int]
        """

        # find the node with two parents
        parent = {}
        for u, v in edges:
            if v not in parent:
                parent[v] = u
            else:
                # if there is a cycle, return the edge that has two parents
                return [parent[v], v]

        # find the node with only one parent
        for u, v in edges:
            if u not in parent:
                parent[u] = v
            else:
                # if there is a cycle, return the edge that has only one parent
                return [u, parent[u]]

