        :type grid: List[List[int]]
        :rtype: int
        """

        n = len(grid)
        dp = [[0] * n for _ in range(n)]
        dp[0][0] = grid[0][0]

        for i in range(1, n):
            for j in range(n):
                dp[i][j] = dp[i - 1][j] + grid[i][j]

        for i in range(n - 2, -1, -1):
            for j in range(n - 1, -1, -1):
                dp[i][j] = max(dp[i][j], dp[i + 1][j] + grid[i][j])
