        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """

        if not words:
            return []

        word_len = len(words[0])
        word_count = len(words)
        word_dict = collections.Counter(words)
        res = []

        for i in range(word_len):
            left = i
